class Articles extends Component {
    componentWillMount(){
        this.props.articles();
    }
    render() {
    return (
      <div>
      <div><Link to="articles/new">
            Add an article 
        </Link></div>

        <h1>Articles should apear here:</h1>
      </div>
    )
  }
}

export default connect(null, { articles })(Articles);
